void TML_HMI_SM::InternalSCI::dispatch_event(SctEvent * event)
{
	switch(event->name)
	{
		case InternalSCI_evCloseDrawer:
		{
			internal_raise_evCloseDrawer();
			break;
		}
		case InternalSCI_evHideVolOverlay:
		{
			internal_raise_evHideVolOverlay();
			break;
		}
		case InternalSCI_evHideHvacOverlay:
		{
			internal_raise_evHideHvacOverlay();
			break;
		}
		case InternalSCI_evClosePopupInternal:
		{
			internal_raise_evClosePopupInternal();
			break;
		}
		case InternalSCI_evCloseNotificationInternal:
		{
			internal_raise_evCloseNotificationInternal();
			break;
		}
		case InternalSCI_evClosePopupOnMinTimeout:
		{
			internal_raise_evClosePopupOnMinTimeout();
			break;
		}
		case InternalSCI_evCloseNotificationOnMinTimeout:
		{
			internal_raise_evCloseNotificationOnMinTimeout();
			break;
		}
		default:
			break;
	}
}
